import React from "react";
import { View, Text, StyleSheet,TouchableOpacity,Button } from "react-native";
import { Card, Title, Paragraph,}  from 'react-native-paper';
import { FontAwesome5 } from '@expo/vector-icons';

const ConfigScreen = ({navigation}) => {
  const onPress = () => navigation.navigate("Tools");
  return (

     <TouchableOpacity >    
     <Card style = {styles.cardStyle}  onPress={onPress} >
    
     <Card.Content>
     <Title style = {{textAlign: "center", fontWeight: "bold"}}>Add Device</Title>
      <View style = {{alignItems: "center"}}><FontAwesome5 name="plus" size={64} color="black" /></View>
     </Card.Content>
    </Card>
    </TouchableOpacity>
    
 
  );
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#242945',
        alignItems: 'center',
        justifyContent: 'center',
      
       
    },
    cardStyle: {
        
        width: '80%',
        marginTop: '50%',
        backgroundColor:'#d4aa04',
        // flexDirection: 'row',
        margin: '10%',
        borderRadius: 15
    }

}
)


export default ConfigScreen;
